Le 1er, tendant à autoriser la ville de Riom
(Puy-de-Dôme) à emprunter 770,000 fr. et à
s'imposer extraordinairement;

Le 2e, tendant à autoriser la ville de Gre-
noble (Isère) à emprunter une somme de
400,000 fr.;

Le 3e, tendant à établir d'office sur la com-
mune de Tacoignières (Seine-et-Oise) une
imposition extraordinaire ;

Le 4e, tendant à établir d'office sur la com-
mune de la Rabetelière (Vendée) une im-
position extraordinaire ;

Le 5e, tendant à établir d'office une impo-
sition extraordinaire sur la commune de
Saint-Sulpice et Cameyrac (Gironde);

Le 2e, portant prorogation et exhausse-
ment d'une surtaxe perçue sur le vin à l'oc-
troi de Mézières (Ardennes);

Le 3e, portant création de surtaxes sur le
vin et sur l'alcool à l'octroi de Cléder (Fi-
nistère);
